import React, { useState } from 'react';
import unliked from '../resources/unliked.png'
import liked from '../resources/unliked.png'
const ListaImagenes = ({imagenes}) => {

    const [estrella, cambiarEstrella, agregarFavorito, favoritos] = useState(unliked);

    return ( 
        <div className='contenedor'>
            <div className='lista-imagenes thumbnail'>
                {imagenes.map((foto) => (
                    <div className='tarjeta'>
                        <img className="imagen" key={foto.id} src={foto.urls.thumb} alt={foto.alt_description} />
                        <img onClick={() => {agregarFavorito(foto.id)}} src={estrella} className='botones'></img>
                    </div>
                ))}
            </div>
        </div>
     );
}
 
export default ListaImagenes;
